import React from 'react';
import EggCard from './EggCard';

const Egg = () => {
  //调用getallNFt方法获取所有NFT
  const eggsData = [1, 2, 3, 4, 6]; // 假设有一些egg的数据

  return (
    <div>
      <h1>Egg Component</h1>
      <div className="egg-container" style={{ width: '20%' }}>
        {eggsData.map((egg) => (
          <EggCard key={egg.id} data={egg} />
        ))}
      </div>
    </div>
  );
};

export default Egg;
